import React from 'react'
import { Pie, PieChart, Tooltip } from 'recharts'
import Gender from './Gender';
function Genderchart() {
   
  {
    const data = [
      {name: "Male",value:13},
      {name:"Female",value:10},
      {name:"Required",value:5},
    ];
    return(
      <div className='chart'>
    <h1>Genderchart</h1>
    <div>
    <PieChart width={500} height={600}id='piechart' >
    <center><Pie 
    dataKey="value"
    data={data} 
    innerRadius={60}
    outerRadius={110}
    fill='orange'
    />
    <Tooltip/></center>
    </PieChart></div>
      </div>
    )
  }
}


export default Genderchart
